package com.proquifa.net.modelo.comun;

public class ReferenciaBancaria {

	private String moneda;
	private String banco;
	private String sucursal;
	private String cuenta;
	private String clabe;
	private String refCliente;
	
	public ReferenciaBancaria() {
		super();
		// TODO Auto-generated constructor stub
	}

	/**
	 * @return the moneda
	 */
	public String getMoneda() {
		return moneda;
	}

	/**
	 * @param moneda the moneda to set
	 */
	public void setMoneda(String moneda) {
		this.moneda = moneda;
	}

	/**
	 * @return the banco
	 */
	public String getBanco() {
		return banco;
	}

	/**
	 * @param banco the banco to set
	 */
	public void setBanco(String banco) {
		this.banco = banco;
	}

	/**
	 * @return the sucursal
	 */
	public String getSucursal() {
		return sucursal;
	}

	/**
	 * @param sucursal the sucursal to set
	 */
	public void setSucursal(String sucursal) {
		this.sucursal = sucursal;
	}

	/**
	 * @return the cuenta
	 */
	public String getCuenta() {
		return cuenta;
	}

	/**
	 * @param cuenta the cuenta to set
	 */
	public void setCuenta(String cuenta) {
		this.cuenta = cuenta;
	}

	/**
	 * @return the clabe
	 */
	public String getClabe() {
		return clabe;
	}

	/**
	 * @param clabe the clabe to set
	 */
	public void setClabe(String clabe) {
		this.clabe = clabe;
	}

	/**
	 * @return the refCliente
	 */
	public String getRefCliente() {
		return refCliente;
	}

	/**
	 * @param refCliente the refCliente to set
	 */
	public void setRefCliente(String refCliente) {
		this.refCliente = refCliente;
	}
	
	
	
}


